import CartItem from "./CartItems";

export default function Cart(){
    return (
        <div>
            <div>
                <CartItem />
                <div>
                    <h2>Total Amount</h2>
                    <div>
                        <p>$</p>
                        <div>
                            <button>Close</button>
                            <button>Order</button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
